import React from "react";
import { noteContext, fileContext } from "./NoteContext";

const NoteState = (props) => {
    const state = {
        "name": "gaurang",
        "work": "react"
    }
    return (
        <noteContext.Provider value={state}>
            <fileContext>
                {props.children}
            </fileContext>
        </noteContext.Provider>
    )
}


export default NoteState
